def c_undefined_value(self, rtype: RType) -> str:
    if not rtype.is_unboxed:
        return "NULL"
    elif isinstance(rtype, RPrimitive):
        return rtype.c_undefined
    elif isinstance(rtype, RTuple):
        return self.tuple_undefined_value(rtype)
    assert False, rtype

